      "description": "<p>ACERCATE 50 VECES MÁS A OBJETOS ALEJADOS</p><p>Con el innovador lente periscópico para telefotografía, podés sacar fotos a la distancia sin perder nitidez. Además, podés registrar detalles a gran distancia con el Super Zoom de 50x. La estabilización óptica de imagen (OIS) en el zoom compensa automáticamente las fotos y los videos poco nítidos a causa de los movimientos involuntarios de la cámara.</p><br><p>DISFRUTÁ DE TU TELÉFONO EN PANTALLA GRANDE</p><p>Liberá la potencia de tu smartphone con la plataforma Ready For y amplificá todas las funciones del teléfono en un televisor o monitor. Solo conectalo con un cable o de forma inalámbrica, ¡y empezá a disfrutar! Jugá en una pantalla grande para vivir una experiencia a pura adrenalina, hacé videollamadas como si estuvieras en el lugar o trabajá como si fuera una computadora.</p><br><p>VELOCIDAD SUPERIOR</p><p>Aprovechá toda la capacidad de memoria que necesitás para tu estilo de vida con el potente procesador Qualcomm® Snapdragon™ 870. Conectate a una red 5G y realizá descargas y transmisiones superveloces. O bien, accedé a una red Wi-Fi 6 que es aún más rápida</p><br><p>DISEÑO MODERNO Y ELEGANTE</p><p>El atractivo acabado mate del vidrio posterior otorga una apariencia increíble desde todos los ángulos. Las opciones de colores y su cautivante diseño curvo hacen que este teléfono se destaque. Además, podés guardarlo fácilmente en tu bolsillo gracias a su espesor de menos de 8 mm.</p><br><p>Control remoto \"Ready For Air Remote\"</p><p>Ready For Air Remote Bluetooth® funciona con Ready For, una nueva plataforma que lleva la experiencia del teléfono a cualquier computadora, televisor o monitor:</p><p>• Juegos en la pantalla grande</p><p>• Videollamadas reales con una mejor calidad</p><p>• Un espacio de trabajo amplio y ordenado</p><br><p>Contenido de la caja: Manual/Guía de usuario, Cable de Sincronización, Cargador de viaje, Funda protectora de silicona, Herramienta de Remoción de SIM y Control Ready For Air.</p><br><br><p>¿Hacen factura A?</p><p>Para que podamos emitir la factura A, necesitamos que la cuenta de Mercado Libre desde donde vayas a realizar la compra, esté registrada como IVA Responsable Inscripto o IVA Exento. De lo contrario, se va a emitir automáticamente una factura B.</p><p>Podrás actualizar esta información desde la sección \"Mis datos\".</p><br>",
