      "price": null,
      "condition": "Nuevo",
      "description": "<p>DISTRIBUIDORES UNICOS y OFICIALES de ULEFONE Argentina</p><br><p>L A T I T U D E S • S U R //</p><p>¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨</p><p>- PRODUCTO NUEVO - CAJA CERRADA -</p><br><p>ENVÍOS AL INTERIOR POR:</p><p>- Mercadoenvíos - GRATUITO -</p><p>- Expresos, Jetpack.</p><br><p>ENVÍOS DENTRO DE C.A.B.A Y G.B.A:</p><p>- Motomensajería (Consultar costo)</p><p>- Mercadoenvíos - GRATUITO –</p><br><p>FORMAS DE PAGO:</p><p>- MercadoPago, Tarjeta de Crédito o Débito</p><br><p>NUESTRO HORARIO DE ATENCIÓN ES DE 11 A 17 DE LUNES A VIERNES.</p><br><p>UBICACIÓN:</p><p>- Nos encontramos en el barrio de COLEGIALES.</p><p>Transporte: Línea D ESTACIÓN MINISTRO CARRANZA/ Colectivos: 39, 41, 67, 68, 108, 110, 140, 151, 168</p><br><p>•••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••</p><p>Descripción del producto</p><p>Cámara de imágenes térmicas</p><p>La cámara integrada de imágenes térmicas FLIR con tecnología MSX de los teléfonos inteligentes Ulefone Armor 9 puede detectar objetos en la escena y crear imágenes térmicas basadas en las anomalías de la temperatura, como la pérdida o ganancia de calor de los objetos o seres vivos que pueden esconderse a plena vista, ayudándole a encontrar y resolver los problemas más rápidamente.</p><br><br><p>Captura imágenes de ultra claridad</p><p>El sistema de súper cámara de Armor 9 cuenta con el sensor de imagen de ultra alta resolución Samsung GW1 64MP con Tetracell y tecnología 3D integrada, que le permite capturar imágenes y video más detallados incluso en ambientes mixtos y desafiantes. Cuatro flashes de alto brillo en la parte posterior ayudan a capturar el tesoro y la belleza del mundo incluso en circunstancias de luz insuficiente.</p><br><br><p>Una versátil cámara de inspección industrial</p><p>Ulefone Armor 9 tiene una interfaz de expansión para un endoscopio flexible a la izquierda. El endoscopio es impermeable y viene con un cable semirrígido, con el que se puede ver en muchos lugares difíciles de alcanzar, estrechos y confinados en casa o en el exterior, como el HVAC, el tubo de ventilación, los motores de los coches, el aire acondicionado, las esquinas de los sofás, etc.</p><br><br><p>A prueba de agua, polvo y caídas</p><p>El Ulefone Armor 9 cumple con toda una lista de estándares de rendimiento avanzados, incluyendo IP68, IP69K, MIL-STD-810G. Es lo suficientemente resistente para soportar el polvo, la suciedad y las caídas repentinas y es resistente a la inmersión hasta una profundidad máxima de 1,5 m bajo el agua durante 30 minutos.</p><br><br><p>Define una excelente durabilidad</p><p>Armor 9 está construido con TPU blando y material de policarbonato reforzado con aleación de aluminio con una excelente artesanía, que puede proporcionar una protección eficaz de la memoria intermedia para el teléfono mientras se cae accidentalmente. Además, las cuatro esquinas reforzadas también evitarán eficazmente los daños por caídas.</p><br><br><p>Proporciona un aislamiento efectivo del agua/polvo</p><p>La avanzada tecnología de sellado y una sólida estructura hacen que la Armadura 9 sea algo más que una simple prueba de salpicaduras. Los tapones a prueba de agua están especialmente diseñados para el puerto USB, el conector de los auriculares y la ranura de la tarjeta SIM, evitando eficazmente que el agua o el polvo entren en el teléfono.</p><br><p>Acceso rápido a diferentes funciones</p><p>La tecla personalizada en el lado izquierdo de Armor 9 puede ser opcionalmente configurada como un acceso rápido a la grabación, la linterna, la captura de pantalla, SOS o cualquiera de sus aplicaciones de uso regular.</p><br><p>Operación conveniente y sensible</p><p>Construido con una pantalla de alta sensibilidad, Armor 9 soporta el modo de guantes que le permite trabajar con la pantalla táctil incluso cuando está trabajando o en el frío.</p><br><br><p>Increíble rendimiento de la IA</p><p>El Armor 9 está potenciado por el más potente SoCfrom MediaTek de la serie P, el Helio P90ehich viene con un rendimiento 4,6 veces mayor que el del Helio P60 y P70 para que puedas realizar cualquier tarea sin perder la eficiencia energética.</p><br><p>Siempre a su servicio</p><p>¿Pasas la mayor parte del tiempo al aire libre y esperas que tu teléfono llegue al final del día?No te preocupes, el Ulefone Armor 9 satisfará tus expectativas. Lleva una impresionante batería de 6600mAh que le durará alrededor de 2 días sin cargarse dependiendo del uso.</p><br><p>Especificaciones técnicas</p><p>-Pantalla: 6,3”</p><p>-Procesador: MediaTek Helio P90</p><p>-RAM: 8GB</p><p>-Almacenamiento: 128GB</p><p>-Batería: 6600mAh</p><p>-Cámara trasera: 64MP</p><p>-Cámara frontal: 8MP</p><p>-SO: Android</p><p>-Dimensiones: 168.2 mm x 82 mm x 15 mm</p><p>-Peso: 320 gramos</p><br><p>Especificaciones de las Imágenes térmicas</p><p>-Rango de temperatura medible: -10C - 40C</p><p>-Cámara de imagen auxiliar de 5MP</p><p>-Visualiza el calor que es invisible a simple vista, resaltando los contrastes de temperatura.</p><br>",
